import Top from "../components/01_top";
import Infotmations from "../components/03_information";
import Archives from "../components/04_archive";
import styles from "./root.module.css";

const Root = ({ className = "" }) => {
  return (
    <div className={styles.root}>
      <main className={[styles.subtract, className].join(" ")}>
        <section className={styles.subtractOneContainer}>
          <img className={styles.subtractIcon} alt="" src="/img_background.jpg" />
          <Top />
          <div className={styles.aboutContainer}>
            <div className={styles.aboutContainerChild} />
            <a className={styles.about}>about</a>
          </div>
          <Infotmations />
        </section>
        <Archives />
      </main>
    </div>
  );
};

export default Root;
